class Solution {
  List<int> leftmostBuildingQueries(List<int> heights, List<List<int>> queries) {
    int n = heights.length;
    List<int> nextGreater = List.filled(n, -1);
    List<int> ans = List.filled(queries.length, -1);
    List<int> stack = [];

    for (int i = n - 1; i >= 0; i--) {
      while (stack.isNotEmpty && heights[stack.last] <= heights[i]) {
        stack.removeLast();
      }
      if (stack.isNotEmpty) {
        nextGreater[i] = stack.last;
      }
      stack.add(i);
    }

    for (int i = 0; i < queries.length; i++) {
      int a = queries[i][0], b = queries[i][1];
      if (a > b) {
        ans[i] = -1;
        continue;
      }
      while (a < b && a != -1) {
        a = nextGreater[a];
        if (a != -1 && a <= b) {
          ans[i] = a;
        }
      }
    }

    return ans;
  }
}
